-- Table structure for rubber_scheme_node
-- ----------------------------
DROP TABLE IF EXISTS `rubber_scheme_node`;
CREATE TABLE `rubber_scheme_node`  (
  `node_id` int NOT NULL AUTO_INCREMENT,
  `scheme_id` int NOT NULL,
  `node_key` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
  `type` int NOT NULL DEFAULT 0 COMMENT '节点类型：0开始，1线，2执行节点，3排他网关，4并行网关，5汇聚网关，9结束',
  `name` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '代号',
  `prve_key` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '上个节点ID（type=line时，才有值 ）',
  `next_key` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '下个节点ID（type=line时，才有值 ）',
  `condition` varchar(400) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '分支条件（type=line时，才有值 ：left,op,right,ct;left,op,right,ct）',
  `tasks` varchar(400) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '执行任务（type=exec时，才有值：F,tag/fun1;R,tag/rule1 ）',
  `actor` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '参与者（type=exec时，才有值 ：tag/name）',
  `actor_display` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL,
  `last_updatetime` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  `is_enabled` int NULL DEFAULT 0 COMMENT '是否启用  0：未启用  1：启用 ',
  PRIMARY KEY (`node_id`) USING BTREE,
  UNIQUE INDEX `IX_key`(`scheme_id`, `node_key`) USING BTREE,
  INDEX `IX_scheme`(`scheme_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 199 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = 'RAAS-计算方案-节点表' ROW_FORMAT = Dynamic;

