  `name` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '服务器名称',
  `iaas_key` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '基础设施服务KEY',
  `iaas_type` int NOT NULL DEFAULT 0 COMMENT '基础设施类型（0ECS, 1BLS, 2RDS, 3Redis, 4Memcached,5DRDS）',
  `iaas_attrs` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '特性',
