  INDEX `IX_key`(`iaas_key`) USING BTREE,
  INDEX `IX_iaas_account`(`iaas_account`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin COMMENT = 'WATER-运维-服务器表' ROW_FORMAT = Dynamic;

