  `is_enabled` int NOT NULL DEFAULT 1 COMMENT '是否为已启用',
  PRIMARY KEY (`service_id`) USING BTREE,
  UNIQUE INDEX `IX_key`(`key`) USING BTREE,
  INDEX `IX_address`(`address`(100)) USING BTREE
