INSERT INTO `paas_etl` VALUES (82, 'angel', 'user_state_beauty_zmscore', '{\n	include:\"etl_angel/open_id_get\",\n	source:{\n		db:\"etl.beauty_user\",\n		table:\"user_zm_score\",\n		key:\"user_id\",\n		cursor:\"update_time\",\n		model:\"SELECT a.zmscore zm_score,a.update_time,b.mobile FROM user_zm_score a INNER JOIN `user` b ON a.user_id = b.user_id WHERE a.update_time>@timestamp  ORDER BY a.update_time ASC\",\n		limit: 1000\n	},\n	target: {\n		db: \"etl.angel_test\",\n		table: \"user_state\",\n		key: \"open_id\",\n		cursor: \"log_fulltime\",\n		constraint:\"open_id\",\n		require:\"open_id\", \n		policy:2, \n		lock:\"open_id\",\n		fields: \"open_id,zm_score\",\n		trans: {\n			\"open_id\":\"$etl_angel_open_id_get(m)\"\n		}\n	}\n}', 0, 0, 0, 1, 0, 0, NULL, 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (83, 'angel', 'user_state_beauty_id_name', '{\n	include:\"etl_angel/open_id_get\",\n	source:{\n		db:\"etl.beauty_user\",\n		table:\"user_ex_identification\",\n		key:\"user_id\",\n		cursor:\"update_time\",\n		model:\"SELECT a.id_name,a.update_time,b.mobile FROM user_ex_identification a INNER JOIN `user` b ON a.user_id = b.user_id WHERE a.update_time>@timestamp  ORDER BY a.update_time ASC\",\n		limit: 1000\n	},\n	target: {\n		db: \"etl.angel_test\",\n		table: \"user_state\",\n		key: \"open_id\",\n		cursor: \"log_fulltime\",\n		constraint:\"open_id\",\n		require:\"open_id,id_name\", \n		policy:2, \n		lock:\"open_id\",\n		fields: \"open_id,id_name,is_real\",\n		trans: {\n			\"open_id\":\"$etl_angel_open_id_get(m)\",\n			\"is_real\":\"1\"\n		}\n	}\n}', 0, 0, 0, 1, 0, 0, NULL, 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (84, 'angel', 'user_state_beauty_td_score', '{\n	include:\"etl_angel/open_id_get;etl_angel/td_score_get_from_oss\",\n	source:{\n		db:\"etl.beauty_user\",\n		table:\"user_risk_td\",\n		key:\"user_id\",\n		cursor:\"update_time\",\n		model:\"SELECT a.risk,a.update_time,b.mobile FROM user_risk_td a INNER JOIN `user` b ON a.user_id = b.user_id WHERE a.update_time>@timestamp  ORDER BY a.update_time ASC\",\n		limit: 1000\n	},\n	target: {\n		db: \"etl.angel_test\",\n		table: \"user_state\",\n		key: \"open_id\",\n		cursor: \"log_fulltime\",\n		constraint:\"open_id\",\n		require:\"open_id,td_score\", \n		policy:2, \n		lock:\"open_id\",\n		fields: \"open_id,td_score\",\n		trans: {\n			\"open_id\":\"$etl_angel_open_id_get(m)\",\n			\"td_score\":\"$etl_angel_td_score_get_from_oss(m)\"\n		}\n	}\n}', 0, 0, 0, 1, 0, 0, NULL, 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (85, 'angel', 'user_state_rock', '{\n	include:\"etl_angel/open_id_get\",\n	source:{\n		db:\"etl.rock_user\",\n		table:\"user\",\n		key:\"user_id\",\n		cursor:\"log_fulltime\",\n		model:\"mobile,log_fulltime\",\n		limit: 1000\n	},\n	target: {\n		db: \"etl.angel_test\",\n		table: \"user_state\",\n		key: \"open_id\",\n		cursor: \"log_fulltime\",\n		constraint:\"open_id\"\n		require:\"open_id,mobile\", \n		policy:1,\n		lock:\"open_id\",\n		fields: \"open_id,mobile,log_fulltime\",\n		trans: {\n			\"open_id\":\"$etl_angel_open_id_get(m)\"\n		}\n	}\n}', 0, 0, 0, 1, 0, 0, NULL, 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (86, 'angel', 'user_state_rock_id_name', '{\n	include:\"etl_angel/open_id_get\",\n	source:{\n		db:\"etl.rock_user\",\n		table:\"user_real\",\n		key:\"user_id\",\n		cursor:\"log_fulltime\",\n		model:\"SELECT a.id_name,a.log_fulltime,b.mobile FROM user_real a INNER JOIN `user` b ON a.user_id = b.user_id WHERE a.update_time>@timestamp  and a.state = 1 and a.id_valid = 1 ORDER BY a.log_fulltime ASC\",\n		limit: 1000\n	},\n	target: {\n		db: \"etl.angel_test\",\n		table: \"user_state\",\n		key: \"open_id\",\n		cursor: \"log_fulltime\",\n		constraint:\"open_id\",\n		require:\"open_id,id_name\", \n		policy:2, \n		lock:\"open_id\",\n		fields: \"open_id,id_name,is_real\",\n		trans: {\n			\"open_id\":\"$etl_angel_open_id_get(m)\",\n			\"is_real\":\"1\"\n		}\n	}\n}', 0, 0, 0, 1, 0, 0, NULL, 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', 1, 1, '2018-05-25 14:06:57', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (87, 'beast', 'sync_user_info', '{\n	source: {\n		db: \"beast.beast_user\", table: \"user_info\", key: \"user_id\", cursor: \"last_fulltime\",\n		model: \"*\",\n		limit: 1000\n	},\n	target: {\n		db: \"beast.beast\", table: \"sync_user_info\", key: \"user_id\",\n        cursor: \"last_fulltime\",\n		constraint: \"user_id\",\n	    policy:0,\n		fields: \"*\",\n		limit:100\n	}\n}', 0, 0, 0, 1, 0, 1532310988000, NULL, 1, 1, '2018-12-10 15:08:49', 1, 1, '2018-12-10 15:08:49', 1, 1, '2018-12-10 15:08:49', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (88, 'hold', 'user_to_skb', '{\n    include:\"hold/*\",\n        source:{\n    db:\"hold/rock_user\",table:\"user_real\",\n        key:\"user_id\",\n        cursor:\"user_id\",\n        model:\"select u.user_id,u.mobile,r.id_code,r.id_date_end,r.id_name,r.card_image,r.card_back_image, r.olive_image,r.id_address,u.role_obj_type,v.term_fulltime, b.card_code,b.card_mobile,b.paysys_bank,b.card_image as c_img from`user_real` as r inner join `user` as u on r.user_id= u.user_id INNER join `user_ex_dcard` as b on r.user_id=b.user_id INNER JOIN  `user_state` as s ON r.user_id=s.user_id left JOIN hold.user_ex_vip as v on r.user_id=v.user_id where r.state=1 and b.is_main=1 AND (s.sync_skb_code=10101 or s.sync_skb_code=10109 ) and u.user_id >=@cursor\",\n        limit:1000\n},\n    target: {\n        fields:\"user_id,mobile,id_code,id_date_end,id_name,card_image,card_back_image, olive_image,id_address,role_obj_type,term_fulltime,card_code,card_mobile,paysys_bank,c_img\",\n            policy:11,\n            constraint: \"user_id\",\n            lock:\"mobile,user_id\",\n            require:\"user_id,mobile,id_code\",\n            stream: \"$hold_test_hold_user(m)\"\n    }\n}', 0, 0, 0, 1, 1, 100894, NULL, 1, 1, '2018-08-29 10:42:27', 1, 1, '2018-08-29 10:42:27', 1, 1, '2018-08-29 10:42:27', NULL, NULL, NULL);
