INSERT INTO `paas_etl` VALUES (94, 'hold_push', 'hold.43', '{\n    include: \"hold_push/test\",\n    name: \"hold.push.43\",\n    source: {\n        limit: 1000,\n        model: \"SELECT m.`id_birthday` AS  `id_birthday`,m.`state` AS  `state`,m.`user_id` AS  `user_id` FROM rock_user.`user_real` AS m WHERE 1=1 AND (m.state=1) AND (m.id_birthday<=20000101) \",\n        db: \"hold/rock_user\",\n        table: \"user_real\",\n		cursor:\"user_id\",\n        key: \"user_id\"\n    },\n    target: {\n        stream: \"$hold_push_test(m)\",\n        policy: 10\n    }\n}', 0, 0, 0, 0, 1, 0, NULL, 1, 1, '2018-08-23 09:47:08', 1, 1, '2018-08-23 09:47:08', 1, 1, '2018-08-23 09:47:08', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (95, 'hold_push', 'hold.51', '{\n    include: \"hold_push/JPush;hold_push/CreditRepaymentMsg\",\n    name: \"hold_push.51\",\n    source: {\n        cursor: \"user_id\",\n        limit: 1000,\n        model: \"SELECT m.`id_birthday` AS  `id_birthday`,m.`state` AS  `state`,m.`user_id` AS  `user_id` FROM rock_user.`user_real` AS m WHERE 1=1 AND (m.state=1) AND (m.id_birthday<=20000101) \",\n        db: \"hold/rock_user\",\n        table: \"user_real\",\n        key: \"user_id\"\n    },\n    target: {\n        stream: \"$hold_push_JPush(m,\'测试55\',\'{{m.mobile}}\',\'https://www.baidu.com\',\'https://www.baidu.com\'),$hold_push_CreditRepaymentMsg(m,\'测试55\',\'{{m.mobile}}\',\'https://www.baidu.com\',\'https://www.baidu.com\')\",\n        policy: 10\n    }\n}', 0, 0, 0, 0, 1, 1499147162356, NULL, 1, 1, '2018-10-22 10:55:17', 1, 1, '2018-10-22 10:55:17', 1, 1, '2018-10-22 10:55:18', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (96, 'hold', 'user_to_panda_user', '{\n    source:{\n        db:\"hold/rock_user\",\n		table:\"user\",\n        key:\"user_id\",\n        cursor:\"user_id\",\n        model:\"select user_id,ugroup_id,ukey,agroup_id, user_id open_id,mobile,log_date create_date,log_fulltime  create_fulltime from `user` where  user_id>=@cursor order by user_id\", \n	    limit:5\n},\n    target: {\n	    db:\"panda/panda\",\n		table:\"user\",\n        fields:\"open_id,ugroup_id,ukey,agroup_id,mobile,create_date,create_fulltime\",\n		key:\"open_id\",\n        policy:1,\n		limit:5,\n        constraint: \"open_id\",\n        lock:\"open_id\",\n        require:\"open_id\"\n	  \n    }\n}\n\n', 0, 0, 0, 1, 1, 102283, NULL, 1, 1, '2018-10-09 16:19:40', 1, 1, '2018-10-09 16:19:40', 1, 1, '2018-10-09 16:19:40', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (97, 'hold', 'userreal_to_panda_userreal', '{\n    include:\"hold/*\",\n    source:{\n        db:\"hold/rock_user\",\n		table:\"user_real\",\n        key:\"user_id\",\n        cursor:\"user_id\",\n        model:\"select user_id, user_id open_id,id_code,id_name,id_address,id_date_start,id_date_end,id_nation,id_police,id_sex,id_birthday,card_image,card_back_image ,log_fulltime as create_fulltime,log_date as create_date from user_real where  user_id>=@cursor order by user_id\", \n	    limit:5\n},\n    target: {\n	    db:\"panda/panda\",\n		table:\"user_ex_identification\",\n  fields:\"open_id,id_code,id_name,id_address,id_date_start,id_date_end,id_nation,id_police,id_sex,id_birthday,card_img_url,card_back_img_url,create_fulltime,create_date\",\n		key:\"open_id\",\n        policy:1,\n		limit:5,\n        constraint: \"open_id\",\n        lock:\"open_id\",\n        require:\"open_id\"\n	      trans: {\n			\"card_img_url\":\"$hold_get_imgurl(m.card_image)\",\n			\"card_back_img_url\":\"$hold_get_imgurl(m.card_back_image)\"\n		  \n		}\n	  \n    }\n}\n\n', 0, 0, 0, 1, 1, 10536, NULL, 1, 1, '2018-10-09 10:59:19', 1, 1, '2018-10-09 10:59:19', 1, 1, '2018-10-09 10:59:19', NULL, NULL, NULL);
