INSERT INTO `paas_etl` VALUES (99, 'hold', 'userstate_2_panda_userstate', '{\n   include:\"hold/*\",\n    source:{\n        db:\"hold/rock_user\",\n		table:\"user_state\",\n        key:\"user_id\",\n        cursor:\"user_id\",\n        model:\"select s.user_id, s.user_id as open_id , s.mobile,r.id_name,s.ar_cc_count as credit_card,s.ar_dc_count as debit_card,s.ar_tr_count as cash_record,r.log_fulltime as real_fulltime,r.log_date as real_date,r.id_address,r.id_police from user_state as s left join user_real as r on s.user_id= r.user_id where r.user_id>=@cursor order by s.user_id\", \n	    limit:5\n},\n    target: {\n	    db:\"panda/panda\",\n		table:\"user_state\",\n        fields:\"open_id,mobile,id_name,credit_card,debit_card,cash_record,is_real,real_fulltime,real_date\",\n		key:\"open_id\",\n        policy:1,\n		limit:5,\n        constraint: \"open_id\",\n        lock:\"open_id\",\n        require:\"open_id\"\n	    trans: {\n			\"is_real\":\"$hold_get_user_is_real(m)\"\n		}\n    }\n}\n\n', 0, 0, 0, 1, 1, 10648, NULL, 1, 1, '2018-10-12 18:01:26', 1, 1, '2018-10-12 18:01:26', 1, 1, '2018-10-12 18:01:26', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (100, 'hold', 'ccard 2 panda_ccard', '{\n    include:\"hold/*\",\n    source:{\n        db:\"hold/rock_user\",\n		table:\"user_ex_ccard\",\n        key:\"ccard_id\",\n        cursor:\"ccard_id\",\n        model:\"select ccard_id,user_id as open_id,holder_name,card_code,card_name,card_mobile,bank_name,bank_branch,id_code,expiration_date,quota,date_bill,date_due,date_end,icon,bank_id,remark,examine_state ,log_fulltime as create_fulltime,log_date as create_date from user_ex_ccard where  ccard_id>=@cursor order by ccard_id\", \n	    limit:1000\n},\n    target: {\n	    db:\"panda/panda\",\n		table:\"user_ex_ccard\",\n  fields:\"ccard_id,open_id,holder_name,card_code,card_name,card_mobile,bank_name,bank_branch,id_code,expiration_date,quota,date_bill,date_due,date_end,icon,bank_id,remark,status,create_fulltime,create_date\",\n		key:\"ccard_id\",\n        policy:1,\n		limit:5,\n        constraint: \"ccard_id\",\n        lock:\"ccard_id\",\n        require:\"ccard_id\"\n	    trans: {\n            \"status\":\"$hold_get_card_state(m.examine_state)\"\n		}\n    }\n}\n\n', 0, 0, 0, 1, 1, 207993, NULL, 1, 1, '2018-10-09 10:59:40', 1, 1, '2018-10-09 10:59:40', 1, 1, '2018-10-09 10:59:40', NULL, NULL, NULL);
INSERT INTO `paas_etl` VALUES (101, 'hold', 'dcard_2_pand_dcard', '{\n    include:\"hold/*\",\n    source:{\n        db:\"hold/rock_user\",\n		table:\"user_ex_dcard\",\n        key:\"ddcard_id\",\n        cursor:\"ddcard_id\",\n        model:\"select ddcard_id,ddcard_id as dcard_id,user_id as open_id,holder_name,card_code,card_name,card_mobile,bank_name,bank_branch,paysys_bank,id_code,bank_id,icon,is_main,examine_state,log_fulltime as create_fulltime,log_date as create_date from user_ex_dcard where  ddcard_id>=@cursor order by ddcard_id\", \n	    limit:5\n},\n    target: {\n	    db:\"panda/panda\",\n		table:\"user_ex_dcard\",\n  fields:\"dcard_id,open_id,holder_name,bank_id,card_code,card_name,card_mobile,bank_name,bank_branch,paysys_bank,id_code,icon,is_main,status,create_fulltime,create_date\",\n		key:\"dcard_id\",\n        policy:1,\n		limit:5,\n        constraint: \"dcard_id\",\n        lock:\"dcard_id\",\n        require:\"dcard_id\"\n	    trans: {\n            \"status\":\"$hold_get_card_state(m.examine_state)\"\n		}\n    }\n}\n\n', 0, 0, 0, 1, 1, 186183, NULL, 1, 1, '2018-10-15 15:50:14', 1, 1, '2018-10-15 15:50:14', 1, 1, '2018-10-15 15:50:14', NULL, NULL, NULL);
